import React from 'react';
import { ImageBackground, Image, View, Text, Button, StyleSheet } from 'react-native';
import { useNavigation } from '@react-navigation/native';

//Styling
import { StyledView } from '../styles/wrapper'
import { LogoDiv } from '../styles/wrapper'
import { BttnDiv } from '../styles/wrapper'
import { CheeatahButton } from '../styles/buttons'


const WelcomeScreen = () => {
  const navigation = useNavigation();

  return (
    <StyledView>
      <LogoDiv>
        <View
          
        />
        <BttnDiv>
          <CheeatahButton
            title='Login'
            fontSize='32px'
            onPress={() => navigation.navigate('Register')}
          />
          
        </BttnDiv>
      </LogoDiv>
        
      
    </StyledView>
  );
};

export default WelcomeScreen;
